$(function() {
	var canvasId = 'colorPicker';
	var colorSelected;
	var ctx = document.getElementById(canvasId).getContext('2d');
	var img = new Image();
	var out = $('.span6');
	var origColor = out.css( "background-color" );
	img.src = 'data:image/png;base64,';
	img.onload = function() {
		ctx.drawImage(img, 0, 0);
	}
	$('#' + canvasId).bind('mousemove', function(event) {
		var x = event.pageX - event.currentTarget.offsetLeft;
		var y = event.pageY - event.currentTarget.offsetTop;
		var ctx = document.getElementById(canvasId).getContext('2d');
		var imgd = ctx.getImageData(x, y, 1, 1);
		var data = imgd.data;
		var hexString = RGBtoHex(data[0], data[1], data[2]);
		colorSelected = hexString;
		out.css("background-color", "#"+colorSelected);
	}).bind('mousedown', function(event) {
		origColor = colorSelected;
		out.css("background-color", "#"+colorSelected);
	}).bind('mouseout', function(event) {
		out.css("background-color", "#"+origColor);
	});
});

//from http://www.linuxtopia.org/online_books/javascript_guides/javascript_faq/rgbtohex.htm
function RGBtoHex(R, G, B) {
	return toHex(R) + toHex(G) + toHex(B)
}

function toHex(N) {
	if (N == null)
		return "00";
	N = parseInt(N);
	if (N == 0 || isNaN(N))
		return "00";
	N = Math.max(0, N);
	N = Math.min(N, 255);
	N = Math.round(N);
	return "0123456789ABCDEF".charAt((N - N % 16) / 16) + "0123456789ABCDEF".charAt(N % 16);
}